    const [page, setPage] = useState(0);
    // const [mainAcc, setMainAcc] = useState({ accounts: [] });
    var mainAcc = {};

    const renderAccounts = async () => {
        try {
            await instance
                .post("/balance", {
                    access_token: "access-sandbox-4acad0a3-4e55-4ecc-8a16-8114123c22c4",
                })
                .then((res) => {
                    console.log(res);

                    // setMainAcc({ accounts: res.data });
                    mainAcc = { accounts: res.data };
                    console.log("acc2");
                    console.log(mainAcc);
                });
        } catch (err) {
            console.log(err);
        }
    };

    useEffect(() => {
        renderAccounts();
    });

    const transactionList = (page) => {
        console.log("acc");
        console.log(mainAcc);
        return mainAcc.accounts.accounts.forEach((currentAccount) => {
            // return <Transaction account={currentAccount} />;
            return <h1>hello</h1>;
        });
    };

    return (
        <div id="background">
            <div id="container">
                <table>
                    <thead>
                        <tr>
                            <th>Institution Name</th>
                            <th>Account Type</th>
                            <th>Balance</th>
                        </tr>
                    </thead>
                    <tbody>{transactionList()}</tbody>
                </table>
            </div>
        </div>
    );
};

export default TransactionPage;
